  return (
    <>
      <Title heading={'Todo App'} react={'(ReactApp)'} />
      <div className="row mt-4">
         <Input/>
      </div>
      <div className="row">
         <div className="col-12 d-flex gap-2 justify-content-center mt-5">
           <div className="col-4 col-lg-4" >Ghee</div>
           <div className="col-4 col-lg-3" >1/Mar/2024</div>
           <button className="col-2  col-lg-1 btn btn-outline-danger">delete</button>
         </div>
      </div>
    </>
  );
}
